CREATE TABLE `tbl_food_consumption` (
  `country_id` int DEFAULT NULL,
  `Year` int DEFAULT NULL,
  `description` text,
  `url` text,
  `id` int NOT NULL AUTO_INCREMENT,
  `food_id` int DEFAULT NULL,
  `Fat` double DEFAULT '0',
  `Carbs` double DEFAULT '0',
  `Protein` double DEFAULT '0',
  `total_calories` double DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_food_consumption_country` (`country_id`),
  KEY `fk_food_consumption_food` (`food_id`),
  CONSTRAINT `fk_food_consumption_country` FOREIGN KEY (`country_id`) REFERENCES `tbl_country` (`country_id`),
  CONSTRAINT `fk_food_consumption_food` FOREIGN KEY (`food_id`) REFERENCES `tbl_food` (`food_id`),
  CONSTRAINT `fk_food_country` FOREIGN KEY (`country_id`) REFERENCES `tbl_country` (`country_id`),
  CONSTRAINT `fk_food_food` FOREIGN KEY (`food_id`) REFERENCES `tbl_food` (`food_id`)
) ENGINE=InnoDB AUTO_INCREMENT=471 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
